import { Status, Type } from './models';

type LabelType = {
  children: Type | Status;
};

export const Label = ({ children }: LabelType) => {
  return (
    <span
      style={{
        borderRadius: '12px',
        padding: '8px',
        backgroundColor: children == Type.OneTimeTask ? '00A0A0' : 'FDEE00'
      }}
    >
      {children}
    </span>
  );
};
